import phaser from 'phaser/src/phaser.js';
import ImageURILoaderPlugin from '../../plugins/imageuriloader-plugin.js';

class Demo extends Phaser.Scene {
    constructor() {
        super({
            key: 'examples'
        })
        this.print;
    }

    preload() {
        this.load.rexImageURI('explosion', imageURI, {
            frameWidth: 64,
            frameHeight: 64,
            endFrame: 23
        });
    }

    create() {
        var config = {
            key: 'explodeAnimation',
            frames: this.anims.generateFrameNumbers('explosion', { start: 0, end: 23, first: 23 }),
            frameRate: 20,
            repeat: -1
        };

        this.anims.create(config);

        this.add.sprite(400, 300, 'explosion').play('explodeAnimation');
    }

    update() {
    }
}


var imageURI = 'data:image/png;base64,'

var config = {
    type: Phaser.AUTO,
    parent: 'phaser-example',
    width: 800,
    height: 600,
    scale: {
        mode: Phaser.Scale.FIT,
        autoCenter: Phaser.Scale.CENTER_BOTH,
    },
    scene: Demo,
    plugins: {
        global: [{
            key: 'rexImageURILoader',
            plugin: ImageURILoaderPlugin,
            start: true
        }]
    }
};

var game = new Phaser.Game(config);